INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, 10118, "青空の下で謁見", 2834, 7, 5118061, "ペコリーヌとの出会い", 91002, 1, "フリーマーケット会場", 0, 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, 10118, "未来の騎空団\nマスコット？", 2835, 7, 5118062, "マホとの出会い", 91002, 1, "フリーマーケット会場", 0, 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, 10118, "お嬢さまからの\n緊急依頼", 2837, 7, 5118063, "アキノとの出会い", 91002, 1, "ランドソル市街地", 0, 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, 10118, "黄金色の悩みごと", 4108402, 18, 5118064, "ジュンとの出会い", 91002, 1, "フリーマーケット会場", 0, 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, 10118, "白熱！　格闘大会！", 4107402, 18, 5118065, "カオリとの出会い", 91002, 1, "フリーマーケット会場", 0, 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (1, 40, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, 10118, "祭り太鼓はオーエドの華", 9000227, 16, 5118066, "ニノンとの出会い", 91002, 1, "オーエド町", 0, 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, 10118, "人気者は遅れて\nやってくる", 2101181, 19, 5118067, "スズナとの出会い", 91002, 1, "フリーマーケット会場", 0, 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, 10118, "巫女・ミーツ・魔法少女", 4109402, 18, 5118068, "ナナカとの出会い", 91002, 1, "ランドソル市街地", 0, 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, 10118, "ネズ耳は二度なくなる", 4305402, 18, 5118069, "キャル＆コッコロとの出会い", 91002, 1, "フリーマーケット会場", 0, 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, 10118, "この出会いにカンパイ！", 4101402, 18, 5118070, "ユカリとの出会い", 91002, 1, "ランドソル市街地", 0, 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 40, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, 10118, "陰陽アンサンブル", 4106402, 18, 5118071, "アオイとの出会い", 91002, 1, "ランドソル市街地", 0, 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (1, 40, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, 10118, "運試し十番勝負！", 2836, 7, 5118072, "シノブとの出会い", 91002, 1, "フリーマーケット会場", 0, 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 0, 0, 0, 10118, "彼女たちの新たな日常", 0, 0, 5118600, "オープニング", 0, 0, 0, 10145115, 1);
